import React, { ReactElement, FC, useState, useCallback, useEffect } from "react";
import { getImages } from "../../utils/ImageFetcher";

interface imageDisplayerProps {
    page: number
}

const ImageDisplayer: FC<imageDisplayerProps> = ({ page }): ReactElement => {


    return (
        <section>
            {getImages(page).then(res => res)}
        </section>
    )
}

export default ImageDisplayer
